import styled from "styled-components";

const ButtonStyled = styled.button`
display: inline-block;
color: blue;
font-size: 2em;
margin: 1em;
padding: 0.25em 1em;
border: 1px solid ;
border-radius: 3px;
display: block;

`

export default function Button() {
    return( 
    <>       
        <ButtonStyled />
    </>
    )
}
